#!/bin/bash

# Nicholas McDonald | Wednesday July 3, 2019 | User home folder migration. 
##
##
# Notes:
# This solution assumes there is no Cloud backup solution like Druva InSync in place which would be the preferred workflow, this solution also assumes that the existing macOS Device does not have FileVault enabled, which would introduce additonal challenges. 
##
##
# This solutions requires that the jamfAgent has PPPC permissions to send apple events in order to force the end user to logout after migration
# Additonaly this solution saves the existing home folder on the new machine that is being overwritten as a folder in /Users in the format of username-old

fWelcomeWindow ()
{
	#Welcomes the user to the program, high level explainer, continue button. 
	userchoice=$("/Library/Application Support/JAMF/bin/jamfHelper.app/Contents/MacOS/jamfHelper" -windowType utility -title "Data Migration Tool" -icon /Applications/Utilities/Migration\ Assistant.app/Contents/Resources/MigrateAsst.icns -description "Welcome to the Data Migration tool!

This program will migrate your user home folder from your previous macOS Device. 

When you are ready to begin click continue." -button1 "Continue" -button2 "Cancel" -lockHUD)

	if [[ "${userchoice}" = "2" ]]; then
		
	echo "User Cancled" exit 0 

	elif [[ "${userchoice}" = "0" ]]; then
		
	echo "User Continued" 
	fConnectToMacScreen

	else
		echo "Error... Closing" exit 0 
	fi

}

fConnectToMacScreen ()
{
	#Instructs the user to boot to TDM & connect to the mac using the provided thunderbolt cable, user selects once connected	
	
	userchoice=$("/Library/Application Support/JAMF/bin/jamfHelper.app/Contents/MacOS/jamfHelper" -windowType utility -title "Data Migration Tool" -icon /tmp/tbexample.png -description "Connect your previous Mac.

Using the proivded thunderbolt cable please connect your previous Mac to this computer. 

Once connected, please power on or reboot your previous Mac, Hold down the T key on your old computer as it turns on. 

When your previous Mac shows the thunderbolt logo, similiar to the one shown to the left, please click continue. " -button1 "Continue" -button2 "Cancel" -lockHUD)

	if [[ "${userchoice}" = "2" ]]; then
		
	echo "User Cancled" exit 0 

	elif [[ "${userchoice}" = "0" ]]; then
		
	echo "User Continued" 
	fValidateConnection

	else
		echo "Error... Closing" exit 0 
	fi

}

fValidateConnection ()
{
	if [[ -d "/Volumes/Macintosh HD 1" ]]; then
		echo "Previous Mac Connected..."
		fScanForHomeFolders
	else 
		errorbody="Unable to detect that your previous Mac is connected. Please re-run this tool from Self Service."
		fErrorMessage
	fi
}

fScanForHomeFolders ()
{
	#Scans connected mac for Home Folders, presents home folders to end user, user selects desired home folder to migrate, hides shared folder
	homefolders=$(ls -l "/Volumes/Macintosh HD 1/Users" | awk '{print "\""$9"\""}' | sed 's/"Shared"//g')

	osachoices=$(echo $homefolders | sed 's/ /,/g' | cut -c 4-)

chosehome=$(/usr/bin/osascript<<END
tell application "Self Service"
activate
(choose from list {$osachoices} with title "Home Folder Selection" with prompt "Please select your user Home Folder from your previous Mac\n\nThis Home Folder will replace the currently logged in users home folder." OK button name "Migrate Data" cancel button name "Close")
end tell
END)

if [[ "${chosehome}" = "false" ]]; then
	
echo "User Cancled" exit 0 

elif [[ "${userchoice}" = "" ]]; then
	
echo "OSA timeout, Closing" exit 0 

else
	fMigrateDataConfirmation
fi

}

fMigrateDataConfirmation ()
{
	#Shows the end user the home folder they have selected to migrate, as well as the Home Folder Size.
	previoushomedirectorysize=$(du -hcs "/Volumes/Macintosh HD 1/Users/$chosehome" | awk 'FNR == 2 {print $1}')
	
	userchoice=$("/Library/Application Support/JAMF/bin/jamfHelper.app/Contents/MacOS/jamfHelper" -windowType utility -title "Data Migration Tool" -icon /Applications/Utilities/Migration\ Assistant.app/Contents/Resources/MigrateAsst.icns -description "You have selected the following home directory from your previous Mac to be migrated onto this Mac. 
	
Previous Home Directory: $chosehome 
Previous Home Directory Size: $previoushomedirectorysize
	
Please note any new data you have saved to the home folder of the currently logged in user will be overwritten." -button1 "Continue" -button2 "Cancel" -lockHUD)
	
	if [[ "${userchoice}" = "2" ]]; then
		
	echo "User Cancled" exit 0 

	elif [[ "${userchoice}" = "0" ]]; then
		
	echo "User Continued" 
	fStartDataMigration

	else
		echo "Error... Closing" exit 0 
	fi
	
}

fStartDataMigration ()
{
	#Starts the data migration and shows notice that data migration is in process. Caffeinate? Add a check to ensure migration is completed correctly. Rename the exisitng home folder, then migrate the old folder, then rename to match username.  
	loggedInUser=$(/usr/bin/python -c 'from SystemConfiguration import SCDynamicStoreCopyConsoleUser; import sys; username = (SCDynamicStoreCopyConsoleUser(None, None, None) or [None])[0]; username = [username,""][username in [u"loginwindow", None, u""]]; sys.stdout.write(username + "\n");')
	
	cp -R "/Volumes/Macintosh HD 1/Users/$chosehome" "/Users/$chosehome-CopyInProgress"
	
	mv "/Users/$loggedInUser"  "/Users/$loggedInUser-Old"
	
	mv "/Users/$chosehome-CopyInProgress"  "/Users/$loggedInUser"
	
	chown -R $loggedInUser /Users/$loggedInUser 
	
	fDataMigrationComplete
	
}


fDataMigrationComplete ()
{
	#Prompts the end user that the migration is complete. Closes Program, Unmounts connected Mac, force logout. 
	
	userchoice=$("/Library/Application Support/JAMF/bin/jamfHelper.app/Contents/MacOS/jamfHelper" -windowType utility -title "Data Migration Tool" -icon /Applications/Utilities/Migration\ Assistant.app/Contents/Resources/MigrateAsst.icns -description "Your home folder has been migrated. please logout immediately" -button1 "Logout" -lockHUD)
	
	if [[ "${userchoice}" = "0" ]]; then
		echo "User Chose to logout" 
		osascript -e 'ignoring application responses' -e 'tell application "loginwindow" to «event aevtrlgo»' -e end
	else	
		echo "Error... Closing" 	
		osascript -e 'ignoring application responses' -e 'tell application "loginwindow" to «event aevtrlgo»' -e end
	fi
}



fErrorMessage ()
{
	#Reusable error message prompt 
	echo "Error Message Displayed"
	
	userchoice=$("/Library/Application Support/JAMF/bin/jamfHelper.app/Contents/MacOS/jamfHelper" -windowType utility -title "Data Migration Tool Error" -icon /Applications/Utilities/Migration\ Assistant.app/Contents/Resources/MigrateAsst.icns -description "$errorbody" -button1 "Close" -lockHUD)
	
	 exit 0
}



tbexample=""

base64 -D <<< "${tbexample}" > "/tmp/tbexample.png"

fWelcomeWindow
